description:
First &amp; foremost I want to apologize to everyone. John Lennon said &quot;Life is what happens to you while you are busy making other plans.&quot; That was just the case here.Life suddenly got a lot more busy &amp; a lot more crazy. As I result I stopped uploading my Evie Model vids &amp; pic sets. This wasn't far to those of you you had been faithfully downloading them &amp; hoping for more. For that I am truely sorry.

The good news is I'm back! Things have finally settled down to the point where I feel I can share once again. I have all of Evie's current video &amp; photo sets. I will be posting these once again for all of you to enjoy!

The file names in the photo sets, after 42, get a little weird This is likely to help spot &amp; prevent folks from sharing. I need to figure out what the proper order of the files for these sets is. Restless if you can help with this it'd be greatly appreciated.

Rather than make you all wait even longer I figured I'd start with her vids. I'll be posting all the remaining ones today &amp; will continue seeding them all thru the end of the week. As always let me know if there are any problems &amp; I'll try to fix them ASAP. 

First up is vid # 22. 

